if (this.parameters.has_two) {
  this.parameters.help_f += " and for " + this.parameters.left2
  this.parameters.help_j += " and for " + this.parameters.right2
}

// Build trial list based on block parameters
var rng = this.state.random
var stimuli = this.state.stimuli

var left1 = stimuli[this.parameters.left1]
var left2 = stimuli[this.parameters.left2] || []
var right1 = stimuli[this.parameters.right1]
var right2 = stimuli[this.parameters.right2] || []

var block = this.parameters.block

var trials = this.parameters.trials

var stim_array = []

function interlace(array1, array2) {
  return array1.reduce(
    (arr, v, i) => arr.concat(v, array2[i]),
    []
  )
}

function build_balanced(left, right, is_image, length) {
  // Pick n/2 of left1, n/2 of right1
  var a = rng.sample(left, length/2, true)
  var b = rng.sample(right, length/2, true)

  // This is getting string-y somewhere, force to boolean
  is_image = (is_image == "true" || is_image === true) ? true : false

  // Add details for stimulus presentation and storage
  var astim = a.map(x => ( {stimulus: x, answer: 'f', stimulus_is_image: is_image} ))
  var bstim = b.map(x => ( {stimulus: x, answer: 'j', stimulus_is_image: is_image} ))
  var combined = astim.concat(bstim)

  // And shuffle 'em up.
  // We need to pass a hash function in `helpers`
  // to get it to compare dictionary instances correctly
  return rng.constrainedShuffle(combined, 
    constraints={ minRepDistance: 2 },
    helpers={ hash: x => x.stimulus.toString() + x.answer.toString() + x.stimulus_is_image.toString() },
    maxIterations=10**6)
}

// Now that we can build balanced lists, what kind of list do we want?
if (this.parameters.has_two) {
  var remaining_trials = trials
  var intro_trials = []
  if (this.parameters.attribute_only_trials > 0) {
    // Nosek Brief-IAT paper has 4 trials at the beginning of each block which only get the attribute (words) displayed as a warmup
    remaining_trials -= this.parameters.attribute_only_trials
    intro_trials = build_balanced(left2, right2, false, this.parameters.attribute_only_trials)
  }
  // We have two kinds of stimuli, interlace them
  var one = build_balanced(left1, right1, this.parameters.first_kind_is_picture, remaining_trials/2)
  var two  = build_balanced(left2, right2, false, remaining_trials/2)
  // The final trial list is the introductory trials plus the interlaced results of one and two, so we get alternating category/attribute for the remaining list
  stim_array = intro_trials.concat(interlace(one, two))
} else {
  // We only have one kind of stimuli
  stim_array = build_balanced(left1, right1, this.parameters.first_kind_is_picture, trials)
}

this.options.templateParameters = stim_array
